const CardList = (props) => {

    let cardData = props.info.map((el, index) => {
        return (
                <ul>
                    <Card className={classes.Card}>
                        <CardContent className={classes.CardContent}>
                            {el.text}
                            <Checkbox
                                color="primary"
                                onClick={() => props.boxClick(index)}
                            />
                        </CardContent>
                    </Card>
                </ul>
            )
        })

    return cardData
}



export default CardList
